(5, 1, '接入错误代码一览', '<span style=\"font-family:Microsoft YaHei;\">001=&gt;商户不存在,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">002=&gt;商户账号未审核,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">003=&gt;商户账号已停用,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">004=&gt;商户网站未绑定,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">100=&gt;商户通道关闭,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">101=&gt;商户通道不存在,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">102=&gt;平台通道关闭,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">103=&gt;平台通道不存在,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">104=&gt;商户API功能未开通,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">105=&gt;商户收银台功能未开通,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">106=&gt;支付方式不存在,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">200=&gt;参数不完整,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">201=&gt;Sign验证失败,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">202=&gt;订单金额格式错误,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">203=&gt;订单号长度超过限制(50),</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">204=&gt;备注信息长度超过限制(50),</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">205=&gt;订单号已存在,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">206=&gt;交易网址错误,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">207=&gt;金额超过限定额,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">208=&gt;非法空值,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">209=&gt;订单提交失败,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">210=&gt;订单提交失败,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">211=&gt;订单提交失败,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">212=&gt;订单提交失败,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">213=&gt;订单信息不存在,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">214=&gt;订单提交失败,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">215=&gt;订单已付款,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">216=&gt;订单已关闭,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">217=&gt;订单30分钟内未付款，已关闭,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">300=&gt;同一张卡号提交多次,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">301=&gt;点卡面值错误,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">302=&gt;卡密提交成功,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">303=&gt;卡密已被使用,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">304=&gt;卡面值金额不能小于订单金额,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">400=&gt;其他,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">500=&gt;网关不存在,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">501=&gt;空的银行编号,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">502=&gt;银行接口维护,</span><br font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\" style=\"white-space: normal; box-sizing: border-box;\"><span style=\"font-family:Microsoft YaHei;\">503=&gt;非法的银行编号,</span>', 1, '100', '', 1489198655, 1),
(7, 1, '商户提现什么时候能到？', '<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n	<span style=\"box-sizing:border-box;margin:0px;padding:0px;color:#333333;font-family:&quot;line-height:22.4px;\">T+1提现方案详解</span>\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n	<span style=\"box-sizing:border-box;margin:0px;padding:0px;color:#333333;font-family:&quot;line-height:22.4px;\">1、星期一、星期二、星期三、星期四、<span style=\"box-sizing:border-box;margin:0px;padding:0px;line-height:22.4px;\">星期五、星期六、星期日</span>，0点~23点59分59秒间提现的资金将于次日23点前到账。</span>\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n	<span style=\"box-sizing:border-box;margin:0px;padding:0px;color:#333333;font-family:&quot;line-height:22.4px;\">2、国家法定节假日期间提现的资金将于 节假日后第一个工作日23点前到账。</span>\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n	<span style=\"box-sizing:border-box;margin:0px;padding:0px;color:#333333;font-family:&quot;line-height:22.4px;\">3、如果遇到“<span style=\"box-sizing:border-box;margin:0px;padding:0px;white-space:nowrap;\">不可抗力”因素，将延迟结算（具体看网站公告）。</span></span>\r\n</p>', 1, '100', '', 1489198772, 1),
(14, 2, '禁止涉赌、欺诈、钓鱼、赌博、洗钱等接入!', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;line-height:36px;text-indent:20px;color:#393939;font-family:\" font-size:14px;white-space:normal;\"=\"\">\r\n	<span style=\"margin:0px;padding:0px;font-family:微软雅黑, \" font-size:16px;\"=\"\">为保障正规用户的利益,再次警告那些涉赌，涉黄，欺诈，钓鱼，洗钱的!</span>\r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;line-height:36px;text-indent:20px;color:#393939;font-family:\" font-size:14px;white-space:normal;\"=\"\">\r\n	<span style=\"margin:0px;padding:0px;font-family:微软雅黑, \" font-size:16px;\"=\"\">如触犯法律底线我们将直接锁定帐号不做解释.</span> \r\n</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;line-height:36px;text-indent:20px;color:#393939;font-family:\" font-size:14px;white-space:normal;\"=\"\">\r\n	<span style=\"margin:0px;padding:0px;font-family:微软雅黑, \" font-size:16px;\"=\"\">棋牌游戏类，没有文网文批文的一律禁止接入，明知故犯的锁定账号并不结款.</span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;line-height:36px;text-indent:20px;color:#393939;font-family:\" font-size:14px;white-space:normal;\"=\"\">\r\n	<span style=\"margin:0px;padding:0px;font-family:微软雅黑, \" font-size:16px;\"=\"\">以上行为不仅加重系统售后工作量,更严重的是助长了一些不法分子的增长.</span> \r\n</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;line-height:36px;text-indent:20px;color:#393939;font-family:\" font-size:14px;white-space:normal;\"=\"\">\r\n	<span style=\"margin:0px;padding:0px;font-family:微软雅黑, \" font-size:16px;\"=\"\">为了长远发展和良性的经营环境,一经发现,永久停止使用,请珍惜您的账号.</span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;line-height:36px;text-indent:20px;color:#393939;font-family:\" font-size:14px;white-space:normal;\"=\"\">\r\n	<span style=\"margin:0px;padding:0px;font-family:微软雅黑, \" font-size:16px;\"=\"\">请各位用户做好售后，相互理解，大吉大利，严查欺诈钓鱼赌博，请自重</span> \r\n</p>', 1, '100', '', 1485513654, 1),
(29, 2, '【资金安全风险提示】关于收款风险提示公告', '<span style=\"box-sizing: border-box; white-space: normal; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" yahei\";=\"\" font-size:=\"\" 10px;\"=\"\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">1.我们一直采用的是银行监管商户资金，银行直清资金到商户的模式，不会做任何形式的二清账号（所谓的打款给我们，我们在打款给商户的模式），任何对外宣称我们搞二清的都是欺诈行为，请谨慎谨防上当！</span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\"><span style=\"color: rgb(229, 51, 51);\" font-size:10px;\"=\"\">2.请勿将账号/密码告知任何第三方，如若泄露，</span><span style=\"color: rgb(229, 51, 51);\" font-size:10px;white-space:pre-wrap;\"=\"\">万智通付</span><span style=\"color: rgb(229, 51, 51);\" font-size:10px;\"=\"\">不承认任何连带责任！</span></span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing: border-box; white-space: normal; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" yahei\";=\"\" font-size:=\"\" 10px;\"=\"\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">3.每次新增商户的时候，请以注册的手机来和我们取得联系，确认真实性；我们只对银行卡和营业执照的真实性做审核，而不对银行卡的归属权做审核，如有任何疑问请拨打官方客服电话！</span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing: border-box; white-space: normal; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" yahei\";=\"\" font-size:=\"\" 10px;\"=\"\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">4.我们不会以任何的方式来要求你们换收款银行账号或者更换新的商户！所谓的要求都是骗子！骗子！骗子！重要的事情重复三遍！</span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing: border-box; white-space: normal; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" yahei\";=\"\" font-size:=\"\" 10px;\"=\"\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">5.商户进件之后，不允许做任何的银行卡的更换，除非重新创建新的商户；创建新的商户，审核必须由注册电话联系我们，才可以审核通过！</span>', 1, '100', '', 1520777665, 1),
(30, 2, '【支付订单篡改预警】关于每次订单金额的核验问题，请商户将此通知告知技术', '<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">有些客户在对系统进行支付传递订单的时候，并没有对我们支付成功后下发的金额做二次核验，比如传递上来10块，支付成功，我们回传10块的订单金额，但商户在这步没有做核验；导致有些商户被黑客篡改订单记录，比如10块传递上来变成0.1，我们系统接收到0.1对的金额并且发起支付成功，回传0.1的金额，一旦商户不做核验，只接收通知就认定成功，就会导致被刷单~~所以，切记对我们回传的金额做二次核验！</span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">该疏忽，已经有好几个商户出现过被盗刷，希望广大商户引起注意，杜绝该类简单的逻辑漏洞！</span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">正确流程：</span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#E53333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">商户发起支付订单&gt;传递金额到支付系统&gt;系统接收到传递的金额并且发起支付&gt;支付的金额和结果回传给商户&gt;商户核验结果+金额，2者无误之后，才确认该订单完成</span>', 1, '100', '', 1521013771, 1),
(31, 2, '【投诉处理办法说明】请各位商户仔细查阅，微信@支付宝', '<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:&quot;font-size:14px;line-height:20px;background-color:#FFFFFF;\">为了维护我司渠道号的健康和稳定，不被微信官方降权，导致影响平台所有客户微信支付的开通！</span><br style=\"box-sizing:border-box;white-space:normal;font-family:&quot;color:#333333;font-size:14px;line-height:20px;background-color:#FFFFFF;\" />\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:&quot;font-size:14px;line-height:20px;background-color:#FFFFFF;\">特对系统里产生的投诉做如下处理：</span><br style=\"box-sizing:border-box;white-space:normal;font-family:&quot;color:#333333;font-size:14px;line-height:20px;background-color:#FFFFFF;\" />\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:&quot;font-size:14px;line-height:20px;background-color:#FFFFFF;\">微信渠道后台投诉：</span><br style=\"box-sizing:border-box;white-space:normal;font-family:&quot;color:#333333;font-size:14px;line-height:20px;background-color:#FFFFFF;\" />\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:&quot;font-size:14px;line-height:20px;background-color:#FFFFFF;\">①如果是空投诉，也就是没有投诉内容，则不予理睬，不做处理</span><br style=\"box-sizing:border-box;white-space:normal;font-family:&quot;color:#333333;font-size:14px;line-height:20px;background-color:#FFFFFF;\" />\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:&quot;font-size:14px;line-height:20px;background-color:#FFFFFF;\">②如果是投诉充值未到账等掉单问题，请提供充值到账凭证</span><br style=\"box-sizing:border-box;white-space:normal;font-family:&quot;color:#333333;font-size:14px;line-height:20px;background-color:#FFFFFF;\" />\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:&quot;font-size:14px;line-height:20px;background-color:#FFFFFF;\">③如果是牵扯到其他内容的投诉，则需要支付我司100元/个投诉的投诉罚款</span><br style=\"box-sizing:border-box;white-space:normal;font-family:&quot;color:#333333;font-size:14px;line-height:20px;background-color:#FFFFFF;\" />\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:&quot;font-size:14px;line-height:20px;background-color:#FFFFFF;\">④如果性质特别恶略的，要求各个商户配合退款处理</span><br style=\"box-sizing:border-box;white-space:normal;font-family:&quot;color:#333333;font-size:14px;line-height:20px;background-color:#FFFFFF;\" />\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:&quot;font-size:14px;line-height:20px;background-color:#FFFFFF;\">具体投诉处理办法以我司和商户沟通结果为准！</span><br style=\"box-sizing:border-box;white-space:normal;font-family:&quot;color:#333333;font-size:14px;line-height:20px;background-color:#FFFFFF;\" />\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:&quot;font-size:14px;line-height:20px;background-color:#FFFFFF;\">支付宝官方下发投诉：</span><br style=\"box-sizing:border-box;white-space:normal;font-family:&quot;color:#333333;font-size:14px;line-height:20px;background-color:#FFFFFF;\" />\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:&quot;font-size:14px;line-height:20px;background-color:#FFFFFF;\">①与投诉人取得联系，撤销投诉</span><br style=\"box-sizing:border-box;white-space:normal;font-family:&quot;color:#333333;font-size:14px;line-height:20px;background-color:#FFFFFF;\" />\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:&quot;font-size:14px;line-height:20px;background-color:#FFFFFF;\">②沟通无效，则做协商部分退款或者全部退款处理！</span><br style=\"box-sizing:border-box;white-space:normal;font-family:&quot;color:#333333;font-size:14px;line-height:20px;background-color:#FFFFFF;\" />\r\n<br style=\"box-sizing:border-box;white-space:normal;font-family:&quot;color:#333333;font-size:14px;line-height:20px;background-color:#FFFFFF;\" />\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:&quot;font-size:14px;line-height:20px;background-color:#FFFFFF;\">备注：连续某商户出现大规模投诉，将被清退处理</span>', 1, '100', '', 1521013788, 1),
(32, 2, '【支付资金打款公告】关于各个支付渠道打款说明', '<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">【支付宝、微信、京东、QQ钱包支付端口】：</span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">包含支付宝扫码，微信公众号支付，微信扫码支付、微信小程序支付、京东H5支付、QQ钱包支付</span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">银行D1直清结算，以24点到24点支付的订单为一个结算周期，第2天早上9点30到下午1点30之间银行自动清算，重大节假日另行通知！</span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">备注：</span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">①：如果款未到，请在1点30之后来咨询，我们会在3点左右拉银行的打款回盘文件，查询结果，如果卡号和账号错误，则申请改卡号</span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">②：对私和对公打款都支持，对公双休不支持大额出款，按照5万一笔自动入账，对私无任何大额限制</span><br style=\"box-sizing:border-box;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing:border-box;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">③：所有资金下发打款记录可在【商户后台】&gt;【结算记录】里查看</span>', 1, '100', '', 1521179218, 1),
(33, 2, '【支付投诉问题说明】关于支付投诉客户的说明，高投诉行业禁止接入！', '<pre class=\"prettyprint lang-php\"></pre>\r\n<span style=\"box-sizing:border-box;text-indent:20px;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\"><span style=\"box-sizing: border-box; text-indent: 20px; white-space: normal; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" yahei\";\"=\"\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">温馨提示：</span><br style=\"box-sizing:border-box;text-indent:20px;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing: border-box; text-indent: 20px; white-space: normal; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" yahei\";\"=\"\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">请任何高投诉的客户不要虚报接入系统，如果一旦投诉，轻着冻结账号，重着冻结资金，请慎重接入！</span><br style=\"box-sizing:border-box;text-indent:20px;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing: border-box; text-indent: 20px; white-space: normal; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" yahei\";\"=\"\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">只接受低投诉，并且投诉自行会处理的客户，在新增微信商户的时候，客服电话，请留下真实的客服电话！</span><br style=\"box-sizing:border-box;text-indent:20px;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing: border-box; text-indent: 20px; white-space: normal; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" yahei\";\"=\"\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">如果被投诉了怎么处理？</span><br style=\"box-sizing:border-box;text-indent:20px;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing: border-box; text-indent: 20px; white-space: normal; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" yahei\";\"=\"\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">银行会先冻结商户资金，同时要求商户处理投诉问题，只要合理解决了用户的投诉，立刻重新放款！</span><br style=\"box-sizing:border-box;text-indent:20px;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing: border-box; text-indent: 20px; white-space: normal; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" yahei\";\"=\"\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">禁入行业：</span><br style=\"box-sizing:border-box;text-indent:20px;white-space:normal;font-family:\" color:#333333;font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">\r\n<span style=\"box-sizing: border-box; text-indent: 20px; white-space: normal; color: rgb(229, 51, 51); font-family: \" microsoft=\"\" yahei\";\"=\"\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\">微盘、微交易、博1彩、诱导、欺诈、色情禁入，如果发现冻结资金，不予下发！</span></span><span style=\"box-sizing:border-box;text-indent:20px;white-space:normal;color:#333333;font-family:\" font-size:14px;line-height:20px;background-color:#ffffff;\"=\"\"></span>', 1, '100', '', 1521278070, 1),
(19, 2, '万智通付平台升级维护通知', '<p>\r\n	<span style=\"font-family:Microsoft YaHei;\">随着平台商户日益增加，经平台管理层研究决定，</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-family:Microsoft YaHei;\">将于2016年3月5日 0:00点至7:00点进行系统升级维护。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-family:Microsoft YaHei;\">受此影响，维护期间将暂停 支付功能、商户中心登陆及操作和平台提现功能；</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:Microsoft YaHei;\">开户实名认证等操作时会出现失败情况，请避开该时段进行以上操作。</span> \r\n</p>\r\n<span style=\"font-family:Microsoft YaHei;\">由此给您带来的不便敬请谅解，感谢您的支持。</span>', 1, '100', '', 1504103481, 1),
(20, 2, '万智通付全面升级，现已支持 多种收款方式', '<span style=\"font-family:Microsoft YaHei;\">无卡支付：客户有银行卡，并没有开通网银。</span><br />\r\n<p>\r\n	<span style=\"font-family:Microsoft YaHei;\">信用卡支付：<span style=\"white-space:nowrap;\">万智通付</span>不限额，支付最大金额按对应信用卡所在银行限额情况。</span> \r\n</p>\r\n<span style=\"font-family:Microsoft YaHei;\">网银：客户储蓄卡开通了网上银行支付功能。</span><br />\r\n<p>\r\n	<span style=\"font-family:Microsoft YaHei;\">微信支付：第三方支付方式，只能用于微信。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:Microsoft YaHei;\">消费者可以通过微信直接打开付款或扫一扫付款</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:Microsoft YaHei;\">支付宝支付：第三方支付方式，只能用于支付宝。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:Microsoft YaHei;\">消费者可以通过支付宝APP直接扫一扫或打开支付宝网页付款。</span> \r\n</p>', 1, '100', '', 1504103741, 1),
