CREATE DEFINER=`root`@`localhost` PROCEDURE `kanJiang` (`_betId` INT, `_zjCount` INT, `_kjData` VARCHAR(255) CHARACTER SET utf8, `_kset` VARCHAR(255) CHARACTER SET utf8)  begin
	
