CREATE DEFINER=`root`@`localhost` PROCEDURE `share` (IN `_cid` INT(10), IN `_type` INT(2))  NO SQL
BEGIN

declare _title,_msg,_tmptitle,_editor,_user,_often VARCHAR(800);
declare _now,_period,_addtime,_item,_time int(20) default 0;
declare _amt,_amount,_ratio double(10,2) default 0;

select amount,crowder,crowdid,addtime,ratio into _amount,_user,_item,_addtime,_ratio  from g_crowd_record_28 where itemid=_cid;

select title,period,howoften
into  _tmptitle,_period,_often from g_crowd_28 where itemid=_item;

set _editor='system';

if _often='day' then
set _time=_addtime+_period*24*60*60-5;
elseif _often='minute' then
set _time=_addtime+_period*60-5;
elseif _often='week' then
set _time=_addtime+_period*24*60*60*7-5;
end if;

if FROM_UNIXTIME(_time)<=now() then
    UPDATE g_member SET money=money+_amt,message=message+1 WHERE username=_user;
    select money into _now from g_member where  username=_user;
    set _title=concat('返还投资本金',_tmptitle);
        VALUES (_user,'站内',_amount,_now,UNIX_TIMESTAMP(now()),_title,'','admin',28,_item);
    set _msg=concat(concat('您参与的项目-',_tmptitle,' 已返回投资本金'),_amount,'元');
                values(_title,_msg,_item,0,UNIX_TIMESTAMP(now()),_user,_amount,_ratio,_amount);
end if;



set _amt=_ratio*_amount/100;

UPDATE g_member SET money=money+_amt,message=message+1 WHERE username=_user;

select money into _now from g_member where  username=_user;

